import Style from './setting.module.css';

const Setting = () => {
    return(
        <div className={Style.settingList}>
            <div className={Style.settingCover}>
                <div className={Style.setting}>프로필 편집</div>
            </div>
            <div className={Style.settingCover}>
                <p className={Style.setting}>푸쉬 알림</p>
            </div>
            <div className={Style.settingCover}>
                <p className={Style.setting}>비밀번호 변경</p>
            </div>
            <div className={Style.settingCover}>
                <p className={Style.setting}>필터링 설정</p>
            </div>
            <div className={Style.settingCover}>
                <p className={Style.setting}>차단 목록</p>
            </div>
        </div>
    );
}

const RightSetting = ({settingState, SettingChangeHandler}) => {
    return(
        <div className={Style.wholeCover}>
            <div className={Style.settingListCover}>
                <Setting />
            </div>
            <div className={Style.btnCover}>
                <button className={Style.logoutbtn}>로그아웃</button>
            </div>
        </div>
    );
}

export default RightSetting
